import React, { useState } from "react";
import axios from 'axios'


function Register() {

    const [name,setName]=useState()
    const [email,setEmail]=useState()
    const [password,setPassword]=useState()
    const [phone,setPhone]=useState()
    const [address,setAddress]=useState()

    const handleSubmit=async (e)=>{
        e.preventDefault()
        console.log(process.env.REACT_API);
        try {
            const res=await axios.post(`${process.env.REACT_API}/api/v1/auth/register`,{name,email,password,phone,address})
            if(res.data.success){
                window.alert("success")
            }else{
                window.alert("fail")
            }
        } catch (error) {
            console.log(error);
        }
    }
  return (
    <form action="" onSubmit={handleSubmit} >

    <div className="informations">
      <label htmlFor="">User Name</label>
      <br />
      <input value={name} onChange={(e)=>setName(e.target.value)} type="text" placeholder="Enter Your  Name" />
      <br />
      <label htmlFor="">E-mail</label>
      <br />
      <input
      value={email} onChange={(e)=>setEmail(e.target.value)}
        name="email"
        placeholder="Your Email"
        title="Your Email"
        type="email"
      />
      <br />
      <label htmlFor="">Password</label>
      <br />
      <input value={password} onChange={(e)=>setPassword(e.target.value)} type="password" placeholder="Password" />
      <label htmlFor="">Phone</label>
      <br />
      <input value={phone} onChange={(e)=>setPhone(e.target.value)} type="text" placeholder="Password" />
      <label htmlFor="">Address</label>
      <br />
      <input value={address} onChange={(e)=>setAddress(e.target.value)} type="text" placeholder="Password" />
    </div>
    <button>a</button>
    </form>
  );
}

export default Register;
